INSERT INTO `text` (`id`, `DocumentID`, `RawText`) VALUES
(1, '9d4b04c8-7d6f-487a-be31-70e6e6eb5206', 'Дисциплінарна палата Вищої ради правосуддя підтримала звільнення з посади скандального судді Окружного адміністративного суду Києва Євгена Аблова.\r\n\r\nПро це у Facebook повідомила активістка \"Автомайдану і координаторка проекту \"Просуд\" Катерина Бутко.\r\n\r\n\"Палатою прийняте рішення про притягнення до дисциплінарної відповідальності та внесення подання про звільнення судді Євгена Аблова\", – написала вона.\r\n\r\nАктивістка також розповіла, що перед засіданням у понеділок будівлю ВРП \"замінували\".\r\n\r\nЯк зазначає \"Просуд\", скаргу на суддю подавала Бутко разом із іншим активістом та адвокатом Романом Маселком.\r\n\r\n\"Звичайно, суддя Аблов ще матиме змогу оскаржити дане рішення і ми уважно слідкуватимемо за цим процесом далі\", – кажуть актвісти.'),
(2, 'a26b3cc7-0b14-4f81-a87b-b6cdcb6212df', 'Контрбатарейний радар 1Л220УК успішно завершив польовий етап державних випробувань.\r\n\r\nПро це повідомляє 8 квітня ДК \"Укроборонпром\".\r\n\r\nЗазначається, що випробування, які проходили на одному з полігонів Збройних Сил України, дозволили підтвердити тактико-технічні характеристики 1Л220УК, який значно перевищує за ними контрбатарейні радари, що зараз знаходяться на озброєнні ЗСУ.'),
(3, '996da5fb-3c9c-42d1-a45e-8f62c1a26851', 'Голова уряду РФ Дмитро Медведєв доручив профільним міністерствам, і зокрема Міністерству фінансів, надати підтримку діяльності робочої групи Держдуми з оцінки збитків анексувати Росією Криму за роки його перебування в складі України.\r\n\r\nПро це журналістам у понеділок повідомив глава групи, перший віце-спікер нижньої палати парламенту Іван Мельников, передає ТАСС.\r\n\r\nЗа його словами, робоча групи Думи планувала звертатися до відповідних міністерств за інформацією, а підтримка Медведєв вплине на \"рівень відношення до цих запитів і, відповідно, на якість експертизи\".\r\n\r\n\"Прямо на зустрічі Дмитро Медведєв звернувся, зокрема, до глави Мінфіну з проханням допомагати нам\", - сказав він.'),
(4, '8127355f-7c6e-4dcc-b240-37cef722cca2', 'У с. Верхньоторецьке 54-річна місцева жителька отримала осколкові поранення, підірвавшись на невстановленому предметі під час прибирання на кладовищі.\r\n\r\nПро це повідомляє поліція Донеччини 8 квітня.\r\n\r\nСпівробітники Авдіївського відділення поліції з’ясували, що потерпіла прибирала на кладовищі – і коли потягнула з могили штучні квіти, пролунав вибух.'),
(5, '611dd5c6-2460-4f33-8907-f41cc6f7b115', 'Екс-кандидат у президенти, нардеп Віталій Купрій заявив про створення міжфракційного об\'єднання \"За Зеленського\" у Верховній Раді.\r\n\r\nПро це він сказав на погоджувальній раді 8 квітня.\r\n\r\nКупрій підійшов до віце-спікера Ірини Геращенко і просив надати йому слово для \"дуже важливого для країни оголошення\".\r\n\r\nОднак Геращенко вимкнула мікрофон, тому зі слів Купрія можна було лише почути, що \"президент Порошенко сфальшує вибори через ЦВК\".\r\n\r\n\"Ми бачимо нові обличчя і нові принципи роботи так званої команди. Шкода, що команда, яка претендує на новизну у політиці, починає з хаосу і скандалу\", - сказала Геращенко, яка так і не дала Купрію озвучити заяву.'),
(6, '9fcb04a5-8860-4391-ab77-8a4b81c001dd', 'Українська кіберполіція розпочала спецоперацію \"Пірати\" для протидії порушенням у сфері авторського права.\r\n\r\nПро це інформує 8 квітня офіційний сайт Національної поліції.\r\n\r\nЗа словами начальника Департаменту кіберполіції Сергія Демедюка, операція стартувала по всій країні та триватиме до кінця місяця.\r\n\r\nДемедюк наголосив, що пірати не зацікавлені у наданні громадянам безкоштовного доступу до перегляду відеотворів. Основною їх метою є отримання грошей за розміщення рекламних оголошень на піратських ресурсах.\r\n\r\nТакий заробіток може стартувати від 500 доларів на місяць з одного сайту. При цьому, немає гарантії того, що цей ресурс не несе у собі шкідливого програмного забезпечення.'),
(7, 'c241c7db-c917-4230-b7fa-c3cbf49f16bd', 'Підозрюваного в організації вбивства активістки Катерини Гандзюк  голову Херсонської обласної ради Владислава Мангера госпіталізували через проблеми з тиском.\r\n\r\nПро це \"Українській правді\" повідомила прес-секретар Херсонської облради Галина Ляшевська.\r\n\r\n\"Він у лікарні. У нього гіпертонічний криз\", - зазначила Ляшевська.\r\n\r\nЗа її словами, Мангер перебуває в реанімаційному відділенні в Херсонському обласному кардіологічному диспансері з вечора п’ятниці. \r\n\r\n\"Він почувається стабільно\", - додала прес-секретар Херсонської облради.\r\n\r\nВідзначимо, що у п\'ятницю на Мангера вдягли електронний браслет.'),
(8, 'dc715ed3-24ec-4ead-ac0a-eac774ae7f56', 'Бюро Парламентської асамблеї Ради Європи затвердило термінові дебати, під час яких депутатам запропонують підготувати доповідь, метою якої є відібрати у ПАРЄ право накладати санкції на РФ.\r\n\r\nПро це стало відомо кореспонденту \"Європейської правди\".\r\n\r\nПід час дебатів соціалістка Ліліан Морі Паск\'є, а також лідер групи \"Об’єднані ліві\", нідерландський парламентар Тіні Кокс (якого багато хто вважає головним лобістом інтересів Москви у ПАРЄ) мають запропонувати колегам \"підготувати\" доповідь, яка здатна перевернути розподіл повноважень у Раді Європи.'),
(9, 'a2a6c674-448d-4c50-892d-811b9262ce6c', 'Міський голова Одеси Геннадій Труханов, якого судять за ймовірне розкрадання коштів, заявив, що не вважає себе обвинуваченим.\r\n\r\nПро це він сказав під час допиту в суді у понеділок.\r\n\r\nТруханов стверджує, що правоохоронці порушили закон, повідомляючи йому про підозру. Зокрема, це мав зробити генпрокурор, його заступник, прокурор області чи Києва. За словами очільника Одеса, підозру йому вручав прокурор, який не мав на це права.\r\n\r\nТому він вважає, що не набув статусу ані підозрюваного, ані обвинуваченого.'),
(10, 'be1f8cba-6717-4e06-ae24-034c1d730ce3', 'Боксер Олександр Усик відмовився від титулу чемпіона світу в 1-ій важкій вазі за версією Всесвітньої боксерської асоціації (WBA) і бою з росіянином Денисом Лебедєвим. Про це спортсмен повідомив на своїй сторінці в Instagram.\r\n \r\nРаніше WBA зобов\'язала Усика провести титульний бій проти Лебедєва і призначила промоутерські торги на 28 березня.\r\n \r\n\"Хочу сказати, що організація WBA зобов\'язує мене провести бій із Лебедєвим. Цей бій не відбудеться, тому що ми з командою вирішили перейти в суперважку вагову категорію, тому ми не можемо боксувати з Денисом. Я відмовляюся від пояса, не хочу, щоб він просто так у мене був, нехай хлопці за нього боксують. Денису успіхів, усім хлопцям, хто буде боротися за цей пояс, успіхів! Боксуйте, завойовуйте\", - сказав 32-річний боксер.'),
(11, '8a3fc6c9-5f37-4724-a7a4-6a2ae6b53859', 'Батько знаменитого футболіста і капітана збірної Аргентини Ліонеля Мессі, Хорхе, зіткнувся на своєму автомобілі з мотоциклістом. Про це повідомляє Yahoo Sports.\r\n \r\nДТП сталася ввечері в четвер, 4 квітня, в аргентинському місті Росаріо. Батько капітана збірної Аргентини був затриманий для з\'ясування всіх обставин і проходження медичного огляду.\r\n \r\nПотерпілий був доставлений у лікарню, він отримав легкі травми. Поліцейські вивчають можливість порушення справи проти Хорхе. Він мусить пройти тест на вміст алкоголю в крові, після чого буде оцінено стан його здоров\'я.'),
(12, '7fa4c0b7-59a4-42ba-935a-7e149b0c99f0', 'Легендарний бразильський футболіст Пеле ввечері у вівторок, 2 квітня, був госпіталізований в Парижі. Про це повідомляє радіо RMC Sport.\r\n \r\nТриразовий чемпіон світу був доставлений у лікарню з судомами і високою температурою. Медики змогли зняти напад, зараз життя футбольної легенди поза небезпекою. Діагноз, який поставили Пеле, журналісти не називають.\r\n \r\nВарто відзначити, що перед госпіталізацією Пеле встиг зустрітися в Парижі з форвардом ПСЖ і збірної Франції Кіліаном Мбаппе.'),
(13, '7fc38c0b-d728-41d4-a262-913cb91a84fa', 'На чемпіонаті світу з фігурного катання в Японії представниця Казахстану Елізабет Турсинбаєва під час довільної програми вперше в історії виконала четверне сальто, пише ТАСС у п\'ятницю, 22 березня.\r\n \r\nЗазначається, що 19-річна спортсменка стала першою, кому вдалося успішно виконати стрибок у чотири оберти в дорослому катанні. Першою жінкою, яка намагалася виконати цей елемент, була японка Мікі Андо. На юніорському рівні вона зуміла виконати четверний стрибок у фіналі юніорського гран-прі в сезоні-2002/03. У дорослому катанні японці цей елемент жодного разу не вдався.'),
(14, 'b5ce80a7-5b89-40c6-b5ba-0f38f9157b91', 'Президент Німецького футбольного союзу (DFB) Райнгард Ґріндель (Reinhard Grindel) пішов у відставку. Про це під час телефонної конференції він повідомив керівництво DFB у вівторок, 2 квітня, йдеться у заяві союзу.\r\n\r\nЦе рішення невідкладно набуло чинності. Відтепер Німецьким футбольним союзом керуватимуть двоє його віце-президентів Райнер Кох (Rainer Koch) та Райнгард Раубалль (Reinhard Rauball). Обрання нового президента відбудеться на з\'їзді DFB 27 вересня.'),
(15, '959e1e7e-4fb0-4a93-9e04-f0cd63a9d26f', 'Німецький гонщик Мік Шумахер, син Міхаеля Шумахера, дебютував на гонці Формули-1. Про це повідомляє BBC Sport.\r\n \r\nМолодий 20-річний пілот вперше сів за кермо гоночного боліда головного чемпіонату під час тренувальних заїздів перед Гран-прі Бахрейну. Мік подолав 12 кіл за кермом SF 90.\r\n \r\nСин легендарного гонщика приєднався до колишніьої команди батька Ferrari в січні 2019 року. Напередодні Мік Шумахер дебютував у Формулі-2, опинившись на шостому місці в заїзді в Бахрейні.'),
(16, 'd98333ec-e1e1-4d1f-a017-21ea5747e8b4', 'У Норвегії зняли дивне явище в небі, яке було викликане запуском двох дослідних ракет. Запуск їх був здійснений в рамках дослідницького проекту AZURE, спрямованого на вивчення земної іоносфери. Про це пише Science Alert.\r\n\r\nОперація супроводжувалася видовищними світловими ефектами в небі. Суміш, яку використовували для відстеження потоку заряджених і незаряджених частинок, викликала появу в небі хмар різного кольору.\r\n\r\nМісцеві жителі були вкрай схвильовані світловим шоу, яке їм довелося побачити. Вони навіть почали підозрювати вторгнення іншопланетян.\r\n\r\n\"Коли я побачив дивні вогні і кольорові хмари, що розпускаються в небі, у мене не було жодних пояснень того, що відбувається. Це було схоже на атаку іншопланетян\", - зазначив один з користувачів Мережі і автор відео.'),
(17, '4323e233-a033-4b26-843b-80c193d3ad7b', 'В Україні близько 70% випадків викликів швидкої допомоги є непрофільними, тобто не за призначенням. Про це на своїй сторінці у Facebook заявила в.о. міністра охорони здоров\'я Уляна Супрун.\r\n\r\nТак, Супрун написала, що в більшості випадків швидку викликають не за призначенням.\r\n\r\n\"Непрофільні виклики - під цим бюрократичним висловом криється проблема, яка може коштувати життя. Це виклики екстреної медичної допомоги, які змушують бригади швидкої виконувати ролі таксі, сусідів або сімейних лікарів - в цілому кого завгодно, тільки не своє справжнє призначення\", - написала Супрун.\r\n\r\nЗА ТЕМОЮ\r\n У Мережі обговорюють відео, як водії в Одесі пропускають  швидку \r\nУ Мережі обговорюють відео, як водії в Одесі пропускають \"швидку\"\r\n11 березня 2019, 09:17\r\nТакож Супрун зазначила, що люди заявляють про безпосередню загрозу життю їм або їхнім близьким, проте це не є правдою.\r\n\r\n\"Але після приїзду виявляється, що пацієнт не потребував екстреної допомоги. Наприклад, медиків просять збити тиск, знизити температуру або відвезти в лікарню, коли відсутня пряма загроза життю і здоров\'ю. Взагалі абсурд, коли за екстреною допомогою звертаються, щоб вимкнути газ в квартирі - а буває і таке\", - заявила Супрун.'),
(18, '38062e4f-a26c-4477-b9e4-c5a650e68b07', 'Хмарочоси є однією з основних причин щорічної загибелі щонайменше 100 млн птахів у США, а найбільш тривожна ситуація спостерігається в Чикаго. До такого висновку прийшла група американських учених після проведеного ними дослідження, про результати якого повідомила британська газета The Guardian.\r\n \r\nОрнітологи з Корнельського університету вивчили основні джерела загроз для пернатих і склали список найнебезпечніших для їх проживання американських міст. Результати показали, що як мінімум 100 млн птахів щорічно вмирають у результаті ударів об будівлі, переважно засклені й освітлені хмарочоси. Найнебезпечнішим містом для них став Чикаго, який наповнений усілякими висотками. Саме через нього пролягає більшість міграційних маршрутів перелітних птахів.'),
(19, '93cdc742-1815-4bed-9e53-531d7094857b', 'У Міністерстві охорони здоров\'я констатують, що рівень захворюваності на кір в Україні знову зростає. Про це повідомляє відомство на своїй сторінці у Facebook.\r\n \r\nЗазначається, що на минулому тижні на кір захворіли 2 250 українців, а з початку року - вже 37 328 людини. За цей час від ускладнень кору померло 14 осіб.\r\n \r\n\"Вакцинація - єдиний надійний захист від кору, особливо якщо у вашому регіоні зафіксовано спалах захворюваності\", - йдеться в повідомленні.'),
(20, 'e888d409-0bc4-4c99-a46e-ab25269e5d2b', 'Медики назвали продукти, які допоможуть знизити високий кров\'яний тиск, пише Express.\r\n\r\nЗа словами фахівців, буде корисно обмежити споживання солі й збагатити раціон продуктами, містять калій. Цей елемент допомагає організму ефективніше виводити рідину і тим самим сприяє зниженню тиску.\r\n\r\nНайбільше калію міститься в солодкій картоплі, бананах, томатному соусі, апельсиновому соку й тунці.\r\n\r\nПри цьому занадто багато калію може бути шкідливим, попереджають лікарі. Вони не радять збільшувати вживання калію людям із хворобами нирок.'),
(21, 'ca46ad5c-2c5a-4812-b55a-b84008c0f5ef', 'Знизити ризик серцево-судинних захворювань можна за допомогою віджимань, зроблених за одну хвилину, - чим більше їх буде виконано, тим краще. Про це йдеться в дослідженні вчених з Гарварду, повідомляє Journal of the American Medical Association. \r\n\r\nДослідження проводилося серед співробітників пожежної служби Індіани протягом 10 років.\r\n\r\nУ тих чоловіків, які могли зробити більш як 40 віджимань за хвилину, на 96% знижувався ризик виникнення серцево-судинних захворювань. При цьому у тих, хто віджимається менше, їхній ризик зростав.'),
(22, '0799ec4c-3864-4500-a5d4-713fdd292dcb', 'Американські вчені змогли навчити штучний інтелект розпізнавати людські емоції за виразом обличчя з точністю 98% випадків. Про це повідомляє Case Western Reserve University.\r\n\r\nЗа словами дослідників, новий навик роботів буде використовуватися для соціальної терапії. Наприклад, зчитуючи емоційний стан людини, роботи зможуть вмикати музику, яка відповідає настрою господаря. \r\n\r\nКрім того, роботи зможуть оцінювати здоров\'я своїх господарів, які можуть перебувати в стані депресії або страждати від змін у психічному стані.'),
(23, 'f182e335-4464-44ef-b8c1-314aad2cbe26', 'За даними експертів, у гробниці, вік якої становить понад дві тисячі років, були поховані високопоставлений вельможа на ім\'я Туту і його дружина.\r\n \r\nКрім саркофагів з людськими останками, були виявлені десятки мумій мишей, кішок, собак і навіть сокола.\r\n \r\nКрім того, за межами похоронної камери були знайдені мумії жінки і хлопчика у віці від 12 до 14 років.\r\n \r\nПам\'ятник виявили у жовтні 2018 року завдяки мисливцям за стародавніми артефактами, які проводили там незаконні розкопки. Зловмисників затримали.'),
(24, '2ddff2bc-c19e-4cf9-9788-1083f61c28df', 'Вчені знайшли в Перу скам\'янілі останки морського ссавця. Про це повідомляє ВВС.\r\n\r\nПалеонтологи виявили скелет чотириногого кита з перетинчастими лапами і копитами. Вчені припускають, що морський ссавець міг не тільки плавати, але і пересуватися сушею.\r\n\r\nЦе морське чудовисько еволюціонувало від дрібних копитних ссавців до блакитного кита. Особи могли досягати чотирьох метрів завдовжки.'),
(25, '2abcbcca-1cd7-4ee5-9024-989672e752ad', 'Група російських вчених визначила професії, які в майбутньому стануть непотрібними через впровадження роботів. На думку фахівців, багато професій, пов\'язаних з ручною працею, стануть непотрібними. Про це пише Вечерняя Москва.\r\n\r\nОчікується, що вже до 2025 року частка ручної праці знизиться в багатьох сферах, а співробітники сфер послуг потраплять під скорочення. У процентному співвідношенні частка роботи, що виконується роботами, буде досягати 48% і 52%. Серед професій із \"зони ризику\" названі офіціанти, касири й інші.'),
(26, '290c5398-40f2-4b9b-ba17-db93db26605a', 'У Цюріхському університеті та університеті Брістоля група вчених передбачила можливість повного вимирання дельфінів. Про це повідомляється на сайті Брістольського університету.\r\n \r\nФахівці вивчили дані про вплив глобального потепління і підвищення температури води на репродукцію дельфінів біля узбережжя Австралії. Виявилося, що підвищення температури в затоці Шарк на чотири градуси \"вбило\" значну частину місцевих водоростей, які є основою екосистеми.'),
(27, '81e1d232-d174-42d2-bf7f-38f741018449', 'Група шведських вчених із Королівського технологічного інституту в Стокгольмі винайшла новий вид матеріалу - прозору деревину, яка може бути використана для зведення будівель із низьким рівнем споживання енергії. Завдяки своїм властивостям ця сировина, як повідомляє газета The Guardian, цілком може замінити пластик або скло.\r\n \r\nПрозора деревина не тільки володіє високою щільністю і прозорістю, а й здатна зберігати і виділяти тепло, відзначають дослідники. \"Ми створили багатофункціональний матеріал - він може дуже добре передавати світло, а також накопичувати енергію\", - зазначила професор КТІ Селін Монтанарі.'),
(28, '09016054-e340-4e14-b4e2-20aaf49a8d13', 'Група вчених з Імперського коледжу Лондона спрогнозувала можливе повернення прадавніх лісів в Антарктиді. За словами фахівців, раніше на Південному полюсі росли дерева. Про це пише The Guardian. Також вони зазначили, що тоді температура на планеті була, в середньому, на 3-4 градуси вищою. При цьому рівень моря був вищим на 20 метрів.'),
(29, '1511dd02-b521-4295-b2eb-c9a3e9d1a537', 'Вчені Колорадського університету вивчили ефективність різних дієт і вправ для схуднення і розповіли, що є найважливішим у боротьбі із зайвою вагою. Результати дослідження були опубліковані в журналі Science Daily. \r\n\r\nФахівці використовували метод подвійної мітки води, що полягає в збагаченні організму важким воднем і важким киснем. За словами дослідників, такий спосіб є набагато більш надійним, ніж використання опитувальників і щоденників харчування. \r\n\r\nВ результаті вчені дійшли висновку, що найефективнішим способом схуднення є саме фізичні навантаження, а не дієти. Дослідження показало, що це дає можливість не тільки швидше витрачати зайві калорії, а й уникнути повернення зайвої ваги. '),
(30, 'f72e8bf9-6f8d-4b37-b913-6d727a2396c6', 'Про це повідомляється на сайті Університету штату Пенсільванія.\r\n \r\nАрхеологи досліджували дно озера Тітікака за допомогою сонара і підводної тривимірної фотограметрії. Проаналізувавши отримані дані, фахівці знайшли та підняли з дна стародавні артефакти.\r\n \r\nВчені відносять їх до культури Тіуанако, що розвинулася на цих територіях у період з 500 по 1100 рік нашої ери. Археологи виявили прикраси із золота і мушель, лампи і керамічні курильниці з головою пуми.'),
(31, '66aeceb8-8e18-40c4-8b25-7da54d649016', 'На базі Арсеналу-Києва в селі Щасливе Київської області спалили машину прямо на тренувальному полі. Про це повідомляє телепередача Профутбол.\r\n \r\nАвтомобіль з іноземними номерами згорів повністю.\r\n \r\n\"Просто заїхала машина і її підірвали або підпалили. Ми дізналися, як, хто і що. Повністю проаналізували камери, починаючи від міста і до Борисполя\", - розповів генеральний директор столичного клубу Олександр Москаленко.\r\n \r\n\"Уже є якісь певні моменти, але я не можу їх розголошувати, бо йдуть слідчі дії\", - додав він.'),
(32, '0b46180e-b9e3-4962-be25-2d91ef35ea4e', 'Федерація фехтування Франції прийняла рішення додати в арсенал професійних фехтувальників світловий меч поряд зі шпагою, рапірою та шаблею, повідомляє АР.\r\n\r\nФедерація офіційно визнала новим видом спорту поєдинки з використанням зброї із Зоряних воєн. Зрозуміло, йдеться не про справжні світлові мечі, якими герої фільму могли розрубати противника навпіл, а про їхні полікарбонатові копії. Копії мечів оснащені кольоровими лампочками і видають характерний рев завдяки вбудованим звуковим чипам.\r\n\r\nУдари по голові і тілу дають учасникам поєдинку п\'ять очок, по нозі і руці - три, по зап\'ястку і пальцях - одне очко. Перемагає той, хто першим набере 15 очок або ж набере більше очок за три хвилини.'),
(33, '6b092cbd-e4fc-4f4b-87aa-2b007a51a101', 'За роки незалежності України за інші країни почали виступати 137 українських спортсменів. Про це у вівторок, 19 лютого, повідомляє УНН з посиланням на дані Міністерства молоді та спорту України. Відзначається, що найбільше українських спортсменів виїхало до Росії - 47, Азербайджану - 25 і США - 12.'),
(34, 'c1544d11-c953-4b7b-a4a6-c8057aedb340', 'Під час матчу плей-оф Ліги Європи Олімпіакос - Динамо в сектор українських уболівальників увірвалася грецька поліція, внаслідок чого постраждали фани київського клубу.\r\n \r\nПро причини виникнення конфлікту поки що не повідомляється.\r\n \r\nЗазначимо, що перед матчем в Піреї ультрас Динамо побилися з місцевими вболівальниками, які використовували ножі і палиці. Деякі фанати київської команди отримали ножові поранення, повідомляє sportarena.'),
(35, '80821782-818d-4a8a-9435-0631717a3857', 'У Києві в середу, 13 лютого, на 76-му році життя помер легендарний форвард ФК Динамо Віталій Хмельницький. Про це повідомляє прес-служба столичного клубу.\r\n\r\n\"Один з кращих вітчизняних футболістів свого покоління, за період з 1965 по 1972 рік Хмельницький провів більше 200 матчів у складі Динамо, чотири рази ставши чемпіоном СРСР і один раз - володарем кубка СРСР\", - йдеться в повідомленні.\r\n \r\nДовгий час він працював у футбольній школі київського Динамо, дитячим тренером, а також у відділі селекції. Багато хто з його вихованців стали відомими футболістами і досягли великого успіху на професійному рівні.'),
(36, '1e95ba50-2c7d-41a8-b25e-538eef51ecc4', 'Клуб MLS Лос-Анджелес Гелаксі створить пам\'ятник англійському футболістові Девіду Бекхему. Про це повідомляє ESPN.\r\n \r\nСкульптуру розташують біля каліфорнійського стадіону, на якому Бекхем захищав кольори Лос-Анджелес Гелаксі в 2007 - 2012 роках.\r\n \r\nУрочисте відкриття пам\'ятника заплановано на 2 березня. Очікується, що сам футболіст також приїде на церемонію.'),
(37, '2a003f49-920d-4f27-97b2-a17d5e3a4904', 'У Парижі помер французький журналіст Жак Ферран, який є одним з творців футбольного турніру Ліга чемпіонів і нагороди Золотий м\'яч. Про це повідомляє Професійна футбольна ліга Франції в Twitter. Жак Ферран, який помер 7 лютого в віці 98 років, був одним з творців формату і правил Кубка європейських чемпіонів (нинішня назва - Ліга чемпіонів), а також членом колегії, яка заснувала нагороду найкращому футболістові світу Золотий м\'яч. Як журналіст він працював у французьких виданнях L\'Equipe і France Football.'),
(38, '3de43c78-cf43-458b-8ae4-1e80afa250af', 'Французький футбольний клуб Нант вимагає в уельського Кардіффа виплатити 15 млн фунтів за перехід форварда Еміліано Сала, який зник після аварії літака над Ла-Маншем, повідомляє Daily Mail. \"Кардіфф оголосив про перехід аргентинського гравця за день до його зникнення. Гроші за трансфер клуб так і не перерахував. Французький клуб пригрозив судовим позовом, якщо вони не отримують платіж протягом 10 днів\", - повідомляє видання.\r\n \r\nВтім, Кардіфф не збирається платити, поки не знайдеться сам футболіст або його тіло.'),
(39, 'b9fae72f-1042-413b-8e2e-0bc68ba868bc', 'Серед уламків потерпілого в районі Ла-Маншу літака, на якому летів аргентинський футболіст Еміліано Сала, виявили тіло. Про це в понеділок, 4 лютого, повідомляє британська Комісія з розслідування авіаційних подій (AIBB), пише ТАСС.\r\n \r\n\"На трагічному відео, знятому з допомогою дистанційно керованого підводного апарату, можна побачити серед уламків тіло однієї людини. AIBB вивчає подальші можливі кроки, консультуючись з родичами пілота і пасажира, а також поліцією\", - йдеться в повідомленні.\r\n \r\nAIBB планують опублікувати попередню доповідь про причини події через місяць після дати трагедії, яка сталася 21 січня.\r\n \r\nЯк відомо, на борту літака в момент події перебувало двоє осіб - футболіст Еміліано Сала і пілот Девід Ібботсон. Інформації про те, чиє саме тіло виявили рятувальники, поки немає.'),
(40, '8886e8e4-ea79-4894-82c9-6d2a36d19457', 'Влада Нормандських островів припинила в четвер, 24 січня, операцію з пошуку легкомоторного літака, на борту якого знаходився футболіст Еміліано Сала. Про це повідомила у Twitter поліція острова Гернсі. \"Ми прийняли складне рішення припинити пошуки\", - йдеться в повідомленні.\r\n \r\nПри цьому наголошується, що шанси вижити у людей, що знаходилися на борту (крім футболіста, на борту був пілот Дейв Ібботсон) \"надзвичайно малі\".\r\n \r\nПошуково-рятувальна операція тривала чотири дні.'),
(41, '0857f1d2-b91f-453e-87f6-07bee3557f07', 'В районі пошуку зниклого літака з футболістом Еміліано Салою в Ла-Манші знайдені різні уламки і предмети. Про це в середу, 23 січня, повідомив головний спеціаліст з льотних досліджень Нормандських островів Джон Фіцджеральд в ефірі Sky Sports. \"Пошуковий літак виявив різні уламки і направив рятувальну шлюпку і рибальський човен до місця пошуків. Подушка, яскраво-оранжевий предмет поруч з тьмяно пофарбованою коробкою і безліч білосніжних предметів, що плавають уздовж злегка вигнутого шматка білого металу. Ось інформація, яку я щойно отримав\", - повідомив Фітцджеральд.'),
(42, '18d5c9cf-f1e6-4c1d-9bf0-90e74182dea3', 'Аргентинський футболіст Еміліано Сала, літак з яким 21 січня зник над Ла-Маншем, встиг записати повідомлення, пише аргентинський портал Ole. За даними видання, Сала зміг відправити голосове повідомлення в груповий чат WhatsApp. \"Привіт, хлопці, як справи? Бро, я без сил. Я закрив купу справ у Нанті, а зараз лечу на літаку, який, здається, ось-ось розвалиться, лечу в Кардіфф. Завтра все почнеться, вдень я приступлю до тренувань з новою командою. Подивимося, що вийде. Як справи, брати і сестри, все гаразд? Якщо через півтори години від мене не буде новин, не знаю, чи пошлють вони когось на пошуки, адже знайти мене неможливо. Боже, як же страшно\", - закінчив повідомлення Сала.'),
(43, 'b51d273b-c14b-4950-864a-b95e5af21438', 'У німецькому Рупольдінгу відбудеться п\'ятий етап Кубка світу з біатлону. Відкриє етап змагань чоловічий спринт. Гонка повинна була відбутися 16 січня, однак через сильні снігопади місцева влада запровадила надзвичайний стан, через що гонку перенесли.\r\n \r\nЗа оновленою інформацією, спринт п\'ятого етапу Кубка світу з біатлону серед чоловіків відбудеться 17 січня о 12:00 за київським часом.'),
(44, '58118fcb-10b5-4d3d-acbe-9220e8a3b0a2', 'Український боксер Віктор Славинський, який виступає в напівлегкій вазі (до 57,2 кг) виступив на вечорі боксу в Лос-Анджелесі в андеркарді поєдинку Ускатегі - Плант.\r\n \r\nЙого поєдинок з 30-річним мексиканцем Анхелем Монрреалем був зупинений вже в першому раунді, хоча був запланований на 4 раунди. Причина зупинки - технічне рішення, найімовірніше, викликане випадковим зіткненням головами, після чого один з боксерів або обидва не можуть продовжувати бій. В такому випадку, перемога присуджується суддями, але тут боксери не встигли показати свою перевагу, тому бій завершився внічию.'),
(45, 'b921e54f-2696-41b0-9784-95f62ecdc912', 'Влада Лас-Вегаса видала ордер для отримання зразків ДНК футболіста туринського Ювентуса і збірної Португалії Кріштіану Роналду, якого підозрюють у зґвалтуванні десятирічної давності. Про це в четвер, 10 січня, повідомила газета The Wall Street Journal.\r\n\r\nЗазначається, що ордер був направлений до Італії, де зараз грає футболіст.\r\n\r\nАдвокат Роналду Пітер Крістіансен заявив, що в цьому немає нічого дивного, оскільки це стандартна поліцейська процедура в рамках слідства.\r\n\r\n\"Роналду завжди говорив, що події 2009 року в Лас-Вегасі мали характер обопільної згоди. Тому не буде нічого дивного у виявленні його ДНК\", - вказав Крістіансен.'),
(46, 'eebd1b34-3f23-48bd-a393-cf3d184f3311', 'Футболіст Дієго Марадона потрапив до лікарні через шлункову кровотечу. Про це в п\'ятницю, 4 січня, повідомило видання А24. Зазначається, що 58-річного футболіста госпіталізували в клініку Olivos в Буенос-Айресі, де він до цього проходив стандартне обстеження перед поїздкою в Мексику. Там він повинен був відновити керівництво футбольним клубом Дорадос.\r\n\r\nВидання уточнює, що у Марадони діагностували невелику грижу стравоходу.\r\n\r\nДочка футболіста Далма написала в Twitter, що стан здоров\'я її батька в порядку. За її словами, незабаром його відпустять додому.'),
(47, 'a4fa65b6-9f08-421f-a2ee-ff5fdcab2f0e', 'Українська тенісистка Еліна Світоліна піднялася з четвертої на третю сходинку в новому рейтингу жіночої тенісної асоціації (WTA), опублікованому на сайті організації.\r\n \r\nЗараз у Світоліної 6085 очок. Вона змістила на четверту сходинку іспанку Гарбінє Мугурусу (5690 очок), незважаючи на програш у чвертьфіналі Australian Open бельгійці Еліз Мертенс.\r\n \r\nПершою ракеткою світу є датчанка Кароліна Возняцкі, яка виграла в турнірі Australian Open 2018.\r\n \r\nВ TOP-100 рейтингу WTA входять ще три українки. Леся Цуренко знаходиться на 40-ій позиції, Катерина Бондаренко стала 80-ою, а Катерина Козлова - 85-ою.'),
(48, '990632b4-b105-4d4b-9d23-5a44f1fa428f', 'Українець Олександр Усик у бою з латвійцем Майрисом Брієдисом завоював титул чемпіона світу за версією WBO і WBC, а також вийшов у фінал Всесвітньої боксерської серії.\r\n \r\nУкраїнський боксер Олександр Усик переміг латвійця Майриса Брієдиса, завоювавши титул чемпіона світу у важкій вазі за версією WBO і WBC.\r\n \r\nПоєдинок пройшов у Ризі в рамках півфіналу Всесвітньої боксерської серії. Усик вийшов у фінал турніру, який відбудеться в Саудівській Аравії в травні.'),
(49, 'df3c827a-0ea0-4c17-ae2a-fbe508b7dca4', 'Міжнародний олімпійський комітет (МОК) зареєстрував 169 спортсменів із Росії для участі в XXIII зимових Олімпійських іграх 2018 року в Пхенчхані. Про це повідомила прес-служба Олімпійського комітету Росії (ОКР).\r\n \r\nПерший віце-президент ОКР Станіслав Поздняков повідомив, що спільна заявка спортсменів і супроводжуючих від Росії на зимові Олімпійські ігри в Пхенчхані складе 340 осіб, у тому числі спортсменів із цієї заявки - 169 осіб.\r\n \r\nУ той же день було названо склад команди \"Олімпійські спортсмени з Росії\" для участі олімпіаді в Пхенчхані.'),
(50, '125dce6d-d0b2-4065-92e1-698c68005751', 'Міжнародний олімпійський комітет (МОК) скоротив кількість російських спортсменів, яких можуть допустити до зимової Олімпіади в південнокорейському Пхенчхані, більш ніж на 100 осіб. Про це повідомляється на сайті МОК.\r\n\r\n\"На сьогоднішній день первісний пул попередньої реєстрації, що складається з 500 спортсменів, був зменшений групою МОК, що відповідає за запрошення спортсменів, на 111 осіб\", - йдеться в повідомленні.'),
(51, '3a01a4e4-3241-45b9-ab4d-9175fdb814b0', 'Кандидат у президенти Петро Порошенко збирається прибути на НСК \"Олімпійський\" і здати аналізи представникам волонтерської антидопінгової організації VADA.\r\n\r\nЦе \"Українській правді\" підтвердило джерело в Адміністрації президента.\r\n\r\n\"Так. Ми плануємо прибути на НСК \"Олімпійський\", - зазначили в АП.'),
(52, 'ea386d2f-752e-448c-b066-a1c79e439380', 'Колишній голова Державної фіскальної служби Роман Насіров подав позов на уряду через оголошення конкурсів на посади очільників Державної митної служби та Державної податкової служби.\r\n\r\nПро це повідомляє 10 квітня прес-служба Окружного адмінсуду Києва.\r\n\r\nЗа даними суду, Насіров у своїх позовних вимогах просить суд визнати протиправними та нечинними розпорядження Кабінету міністрів \"Про оголошення конкурсу на зайняття вакантної посади голови  Державної митної служби України\" та \"Про оголошення конкурсу на зайняття вакантної посади голови  Державної податкової служби України\".'),
(53, '5ad27d6d-c533-4f09-8204-21c44bf3331e', '\"Центр протидії корупції\" звертають увагу, що у планах Володимира Зеленського на випадок обрання президентом не згадується антикорупційна та судова реформи.\r\n\r\nПро це ЦПК написав у Twitter, коментуючи орієнтовні перші 10 кроків Зеленського-президента, оприлюднені представниками його команди.\r\n\r\n\"Він бачить дві ключові проблеми: війна і корупція. Однак є проблема. В оприлюдненому плані немає жодної згадки про: 1) антикорупційний порядок денний 2) порядок денний судової реформи\", – зазначають антикорупційні активісти.'),
(54, '43dc0d05-8363-4a0e-88b9-e352d69756f2', 'Кандидат у президенти комік Володимир Зеленський завзято і ретельно готується до дебатів, де має на меті показати себе виборцям як серйозного політика.\r\n\r\nПро це йдеться у статті \"Української правди\" \"Шоу проти бізнесу. Як Зеленський і Порошенко готуються до другого туру\".  \r\n\r\n\"Він не буде дискутувати із Порошенком, говорити уже немає про що. Вова хоче лише презентувати себе виборцям як серйозного молодого політика\", – розповів один з членів команди Зеленського.\r\n\r\nВідзначається, що загалом команда Зеленського будує свою медіа-кампанію до другого туру навколо двох меседжів.'),
(55, 'ad92cea1-6676-4da2-904b-7a8a5a4fd334', 'Народні депутати Єгор Соболєв та Семен Семенченко, які буди обрані у 2014 році до Верховної Ради за списками об’єднання \"Самопоміч\", оголосили про намір вийти з партії.\r\n\r\nПро це йдеться у повідомленні на сайті політсили.\r\n\r\nЗазначається, що Соболєв уже підписав відповідну заяву, а Семенченко оголосив про намір зробити це найближчим часом. Депутати повідомили про це своїх колег під час засідання фракції.'),
(56, '25c9c2d6-7903-4e8e-8a83-1c2837950f02', 'Український боксер Володимир Кличко закликав кандидатів на пост президента України Петра Порошенка і Володимира Зеленського 10 квітня прибути на НСК \"Олімпійський\" і здати аналізи представникам волонтерської антидопінгової організації VADA, які приїхали до Києва.\r\n\r\nПро це він заявив на спільній прес-конференції з представниками VADA, пише \"Інтерфакс-Україна\".\r\n\r\n\"Я закликаю добровільно кандидатів в президенти України сьогодні прийти в НСК \"Олімпійський\" між 15 і 18 годинами і повторно здати аналізи в компетентні організації та лабораторії\", - сказав брат київського мера.\r\n\r\nЗа словами Кличка, він не спілкується з кандидатами, тому не відомо чи вони прийдуть на стадіон.'),
(57, 'dd82aa6d-7427-4033-8974-ade15f7b913d', 'Державна фіскальна служба включила до реєстру реєстраторів розрахункових операцій 8 новітніх моделей програмних комплексів, призначених для реєстрації розрахункових операцій.\r\n\r\nПро це повідомляє прес-служба ДФС.\r\n\r\nЦі моделі застосовуватимуть у своїй діяльності користувачі-учасники експериментального проекту з впровадження інноваційних технологічних рішень для реєстрації розрахункових операцій у сфері торгівлі (у тому числі інтернет-торгівлі), громадського харчування, купівлі-продажу іноземної валюти, торгівлі через автомати з продажу товарів (послуг), надання послуг з приймання готівки для подальшого переказу, з перевезення пасажирів тощо.'),
(58, '8c8cdb54-db62-490b-a8d3-1755347de00b', 'Президент Петро Порошенко вперше за довгий час зібрав фракцію БПП на нараду, де говорили про те, що кампанія проти іншого кандидата у президенти Володимира Зеленського має стати жорсткою.\r\n\r\nТака зустріч відбулася в АП 8 квітня, йдеться у статті \"Української правди\" \"Шоу проти бізнесу. Як Зеленський і Порошенко готуються до другого туру\".\r\n\r\nВідзначається, що на цій зустрічі Порошенко розповів, що до цього часу він не працював проти Зе на повну силу, але настав час це змінити.'),
(59, 'b0fa3c32-b500-4a26-8085-b04a8d291e6d', 'Давайте назвемо це сотою причиною, чому не слід лишати дитину з гаджетами. Наклацає такого, що не відкрутишся.\r\n\r\nІ таке вже сталося з Еваном Осносом, журналістом видання The New Yorker, пише CNN.\r\n\r\nЧоловік опублікував фото екрана свого гаджета у Twitter і попросив поради у користувачів.'),
(60, 'daea54af-2f57-42de-a169-d1d521359a0e', 'Організатори виставки запрошують старшокласників, студентів і батьків відвідати виставки \"Освіта за кордоном\" та \"Освіта та кар’єра – 2019\", в ході яких будуть представлені більше 100 закордонних та  українських вишів.\r\n\r\nНа виставці майбутні абітурієнти та їх батьки зможуть дізнатися про підготовчі програми, які пропонують навчальні заклади, рівень вимог до сертифікатів ЗНО з навчальних предметів, кар’єрні перспективи після отримання диплому тощо.'),
(61, '1b9db4ce-0e1e-4354-b5e6-b4592ee7f6bc', 'Вона переконана, що однією із таких \"подушечок\" для майбутнього її сина є освіта. Проте, у нашій країні не так просто отримати до неї доступ, коли твоя дитина потребує дещо особливих умов.\r\n\r\n8-річний Лука змалечку ходив лише на індивідуальні заняття – психологи, дефектологи, логопеди тощо.\r\n\r\nКоли прийшов час обирати школу, батьки, Сергій та Олена, вирішили спробувати всі наявні можливості для свого сина.\r\n\r\nОптимізму додавало те, що в Україні почала розвиватися інклюзія, тому не виключали навчання у загальноосвітній школі.\r\n\r\nБула навіть спроба навчати дитину в профільному інтернаті.'),
(62, '7eaa1eaf-e822-42ab-8d38-557845a85bdb', 'Останніми роками, особливо на тлі суперечки з Києвом, уряд Віктора Орбана постійно ставить за приклад відносини Угорщини зі Словаччиною.\r\n\r\nМовляв, раніше, особливо протягом 2008-2011 років, також були безперервні конфлікти, але згодом настало суцільне добросусідство. Та два тижні тому ця ідилія дала тріщину, і причина – дуже знайома українцям.\r\n\r\n27 березня Народна рада Словаччини ухвалила зміни до закону про державні символи. Нова редакція закону має набути чинності з 15 травня.\r\n\r\nЗгідно з ними, гімн іноземної держави можна грати або співати на публічних заходах тільки за присутності офіційної делегації цієї держави.\r\n\r\nІнакше – штраф розміром 7000 євро, який, щоправда, може бути стягнутий тільки з юридичної особи.'),
(63, 'b3c15d4a-dc7e-4384-a4d5-56550ffe0b8d', 'Передвиборний 2018 рік \"приніс\" депутатам-мажоритарникам 4,096 млрд грн з бюджету на соціально-економічний розвиток .  \r\n\r\nВ державному бюджеті є близько 40 різноманітних субвенцій та дотацій, кошти яких з державного передаються до місцевого бюджету. В більшості випадків ці кошти є цільовими. Але також є субвенція на здійснення заходів соціально-економічного розвитку окремих територій, за кошти якої \"борються\" депутати-мажоритарники.'),
(64, '38f19d4a-f7af-4cf3-8fac-f498a9e0fbea', 'Лідерка ВО \"Батьківщина\" Юлія Тимошенко, яка потрапила до трійки лідерів президентських перегонів 2019 року, заявила, що не братиме на себе відповідальності й не даватиме порад, кого з кандидатів варто підтримати у другому турі. \"Країна зараз перебуває в такому кризовому стані, у війні, економічній руїні, крайній бідності, у руйнації інститутів управління. Виклики перед Україною дуже великі. І я вважаю, що жоден з кандидатів, які, за рішенням ЦВК, є в другому турі, не впорається з цими викликами й не припинить ані війни, ані біди. Але я точно вам скажу, що наша робота триває. І ми не чекатимемо на другий тур. Ми зараз об\'єднаємо наші зусилля та спрямуємо їх на те, щоб у другому турі ніхто не зміг сфальшувати вибори\", – сказала Юлія Тимошенко.'),
(65, '55ef89f4-1aab-41ab-ab81-41570a08f66f', 'Софія Павловська – наймолодша \"буктюберка\" України, тобто блогерка, яка розповідає про книжки в YouTube.\r\n\r\nВона з Луцька. Їй 14 років, а на її каналі уже 47 відео, в яких вона розповідає про книги, які прочитала.\r\n\r\nВеде канал школярка більше двох років. В Україні вона – єдина підліток-буктюбер, яка розповідає виключно про літературу.\r\n\r\nАби тримати себе у книжковому тонусі, в середньому читає сім книг на місяць.'),
(66, 'a0a3c4e4-7fe4-4f0c-90dd-8fe6158b424b', 'З понеділка 8 квітня в Польщі почалися протести вчителів, які паралізували роботу більшої частини шкіл і загрожують тимчасово заморозити всю систему освіти.\r\n\r\nТакий масштабний протест зазвичай лояльних педагогів – незвична подія для політичного життя Польщі. Причина цього – передвиборчі перегони, а точніше – бажання партії \"Право і справедливість\" (ПіС) отримати голоси \"різношерстого\", широкого електорату за допомогою створення нових і розширення існуючих програм соціальних виплат.'),
(67, '2890f7b0-369f-437d-b1f4-24f191df8885', 'Кожен перший ранок після виборів в Україні починається з емоцій. Виборці, які ще вчора віддали свої голоси за одного з кандидатів, щиро дивуються результатам виборів по країні загалом, вдаючи, наче не бачили передвиборчих рейтингів та не спілкувались з друзями та родичами. Ці президентські вибори своїми результатами викликали цілий шквал емоцій.\r\n\r\nТа коли емоції вщухають, настає час раціо. І тут можна переходити до перших змістовних підсумків. За що голосували українці, ставлячи галочки у бюлетенях? '),
(68, '651aa1fa-324f-4e2b-8ef8-340b17300b18', 'Жив був собі студент Києво-Могилянської академії і вирішив він зібрати вагон друзів і поїхати в Карпати.\r\n\r\nВагон в прямому сенсі слова: усі свої, ніхто не заважає, гітари і веселощі.  Через півроку усе це повторилося.\r\n\r\nА згодом маленька дружня ідея переросла у проект ГогольTrain – коли весь потяг, оформлений всередині та ззовні, рушить на StartUp ГогольFest до Маріуполя.\r\n\r\nКоманда, у складі Дениса Угорчука, Андрія Янковського і Євгена Ярошенка, розповіла подробиці \"Українській правді. Життя\".'),
(69, '4ba85f14-c90e-4de8-825a-c9a77e3cdf5b', 'Перед тим, як всі з 14 квітня наваляться на фінальний 8 сезон фентезійної \"Гри престолів\" і щоб якось вас розважити після драматичного березня, – надаємо комедії, фантастику і детективи.\r\n\r\nЗ одним попередженням: комедії надаємо чорні, хоч і такі класні, що цього року таких ще не було, і фантастика у нас особлива – не тільки наукова, а й романтична або з додатком жахів.\r\n\r\nДетектив у нас історичний, причому не аби-який, – екранізація славетного Умберто Еко.\r\n\r\nА ще є анімація, рідкісний гість в серіальному житті. Смішна й оригінальна до нестями, справжній, але несподіваний десерт. Хоч і з рейтингом 18+.\r\n\r\nСловом, все разом – серіальний банкет!'),
(70, '639da726-ba09-45c6-9570-23b787156224', 'Найближчим часом Світова організація торгівлі (СОТ) оприлюднить рішення за скаргою України проти Росії.\r\n\r\nЇї офіційна назва звучить сухо і малозрозуміло: \"Справа DS512: Росія – Заходи щодо транзитних перевезень\".\r\n\r\nТа насправді це – ключова торговельна суперечка між Києвом та Москвою, яка розглядалася у СОТ за час нашого членства у цій організації. Ми оскаржували політичну заборону росіян, яка розірвала найкоротший шлях українських товарів на ринки Середньої Азії.\r\n\r\nІ, на жаль, доброї новини ми не маємо. Рішення ухвалене не на нашу користь. Україна програла цю суперечку.'),
(71, '74db36f5-6d0a-483e-ade4-b6eafb28578e', 'Нагадаємо, що після вчорашнього тріумфу в спринті сьогодні Юлія Джима завоювала срібло в гонці-переслідуванні. Після її завершення Юлія прокоментувала свій виступ на чемпіонаті Європи.\r\n \r\n«Моя участь у цьому чемпіонаті було запланована, щоб ще раз перевірити мій стан. Треба було зловити впевненість. Вчора зібралася і працювала у своєму ритмі, сьогодні трохи збилася з нього, зробила по промаху на стійці. Але до чемпіонату світу їх може і не залишитися.'),
(72, '8fcd9580-309b-45b8-82a5-876460fee29a', 'Нагадаємо, сьогодні одна з лідерів жіночої збірної з біатлону Юлія Джима завоювала золото на чемпіонаті Європи в Польщі. Українка не надає значення цьому успіху, роблячи акцент, що готується до ЧС, разом із тим, перемога і стрілянина на нуль явно підняли настрій нашій спортсменці.'),
(73, 'ee54abeb-c734-4e2e-8dfd-eca84f287da5', 'Цього тижня стартував чемпіонат Європи з біатлону, який проходить у польському містечку Душніки-Здруй. Це перші змагання для місцевого стадіону, але мер міста вже заявив про готовність боротися за право проведення етапу кубка IBU наступного року. Хоча на арені ще тривають будівельні роботи. Ось що означає любов до біатлону!\r\n \r\nЗмагання в Душніках проходять на висоті 588 метрів над рівнем моря, однак клімат тут такий, як на висоті 1000 метрів, що пояснюється величезним впливом лісових масивів, в оточенні яких розташований курорт. Проте погода сприяла прекрасним результатам: легкий мороз, що утримує трасу, і слабкий вітер на вогневих рубежах.'),
(74, '7f248f27-4983-4d3a-8926-35c85136a57d', 'Чоловіча естафета стала справжнім подарунком для любителів лижних гонок - дев\'ять команд фінішували у межах трьох секунд. Повторити успіх жіночої збірної вдалося Норвегії. Друга перемога у сезоні!\r\n \r\nЯк і передбачалося, боротьба за золото розгорнулася на останньому етапі між Фіном Хогеном Крогом і Калле Хальварссоном. У більш вигідному становищі був норвежець, що володіє потужним фінішним ривком. Тим більше для Хальварссона етап в Ульрисехамні - перший старт після хвороби. Швед прекрасно усвідомлював це і спробував атакувати заздалегідь, щоб вирватися вперед до фінішної прямої. Однак спроби виявилися безрезультатними, а на фінішній прямій Крог впевнено переграв шведа.'),
(75, 'a8ef9335-07e6-4e0b-9114-070ed4c6df46', 'Третє місце у канадців, яким бронзу на фініші забезпечив Льон Вальяс. Для збірної Канади це другий подіум протягом двох вікендів. Раніше у Тобласі Вальяс разом з Алексом Харвеєб здобули перемогу в командному спринті. Канада має непогані шанси на успіх у чемпіонаті світу в Лахті.\r\n \r\nНа жаль, через застуду Даніеля Стоку не змогла виступити друга збірна Норвегії, за яку мали бігти сервісмени. Однак у кандидата на третій етап не вистачило ФІС-пунктів.'),
(76, 'bc5a47e3-18c2-444c-ab4c-906bb6400cbb', 'Справжній провал чекав нашу команду на першому етапі. За відсутності перевіреного естафетного бійця Олени Підгрушної, тренерський штаб був змушений довірити місце у гонці Журавок Юлії. Перша естафета для 23-річної спортсменки відбулася \"комом\". З головним завданням - відстріляти точно - Юля практично впоралася. Але один додатковий патрон не найбільша проблема цього етапу, а ось жахлива швидкість проходження траси - це проблема для Журавок. 1 хвилина і 10 секунд програшу лідерам і 21-е проміжне місце після першого етапу.'),
(77, '68ec4be0-6102-48c0-8675-4885497c2798', 'Українським уболівальникам залишалося сподіватися тільки на диво. І ми його дочекалися! Чудо під ім\'ям Юлія Джима. Маючи хвилинне відставання, Юля розуміла, що зобов\'язана стріляти чисто, щоб повернути команду хоча б у топ-10. Й у вирішальний момент Джима, вперше в цьому сезоні, працює без додаткових патронів - і Україна вже на шостому місці! Юля ідеально підходить для другого етапу естафети - при хорошому початку вона створить відрив, а в ситуації, яка склалася сьогодні, зможе відіграти важливі секунди.'),
(78, '1291e643-52f0-435e-9ef3-7eae301dc4af', 'Невеликі побоювання викликав наступний етап, на якому бігла Валентина Семеренко. Однак Валя довела, що переживати за її функціональні кондиції не варто. Прекрасна швидкість і непогана стрілянина - Україна починає боротьбу за призові місця. І це після 21-го місця на початку гонки!\r\n \r\nФінішний етап у виконанні Анастасії Меркушиної вийшов гідним. Головне, що молода зірочка нашої збірної не боїться четвертого етапу психологічно і готова до боротьби зі світовими лідерами. Так, поки це не завжди виходить, але чотири секунди програшу Доротеї  Вірер - це хороший результат. Підсумкове четверте місце, яке стало злою долею для України!'),
(79, '2c13e07d-7991-4ab8-b69c-628a557aee35', 'Одноосібним лідером після екватора гонки стала збірна Німеччини з перевагою більш ніж у півхвилини. Надію суперницям на лежанні спробувала подарувати Франциска Хільдебранд, допустивши два промахи і підпустивши до себе італійок і француженок. Проте на стійці Франциска вбила інтригу, відпрацювавши ідеально. Лаура Дальмаєр вирушила на етап пошани! Хоча спроби Лаура Дальмаєр позбутися золота були. Наприклад, три додаткові патрони на останній стрільбі. Але сенсації не сталося. Срібло у збірної Франції.\r\n \r\nЧерез два тижні стартує чемпіонат світу в Хохфільцені, де збірна України має реальні шанси на медалі в естафеті. Все буде залежати від правильної розстановки біатлоністок по етапах.'),
(80, '20cc9613-f59e-4945-9a48-5649e7f3901c', '«Після вчорашньої гонки відчувається сильна завантаженість. Після другого лежання на трасі у мене не залишилося сил. Почали боліти ноги, спина і я практично зупинився. Четверте коло я, можна сказати, пішки йшов, якби ще додали, то п\'яте коло міг взагалі б не доїхати, довелося зменшувати. Погано діє висота, плюс сильна завантаженість. Сподіваюся до чемпіонату світу це дасть позитивний результат», - заявив Підручний.'),
(81, 'b6b55096-0e53-4178-95dd-6431c58a73dc', 'Найкращий з українців у сьогоднішній гонці (18-е місце) - Сергій Семенов - після забігу скаржився на болі в спині і загальну втому, яка завадила йому сьогодні показати більш високий результат.\r\n \r\n\"Із самого початку гонка пішла важко, дуже сильно спина болить, на зубах доїжджав, боротися взагалі не міг. На останньому колі наздогнав Ліндстрема, обійшов його, але на фініші просто не міг їхати і знову пропустив. Тут довгі спуски і потрібно багато працювати в похилому положенні, а спина просто не витримує. Це все моя стара травма, вона нікуди не поділася і періодично дає про себе знати. А тут біжимо вже третій день поспіль і всі спуски такі, де треба працювати. Зараз буде час відпочити, підлікувати її і все буде нормально\", - розповів Семенов.'),
(82, 'a46072c7-f94d-4110-9e6b-3464551ff796', 'Проблеми із самопочуттям мав і Володимир Семаков, який перетнув фініш 25-м.\r\n \r\n\"Вчора і позавчора мені було легше, судячи з того, що говорили хлопці. Але сьогодні перші два кола були швидкі, я йшов у своєму ритмі і все одно накрило на третьому колі. І спина захворіла, і закислення було, і руки не штовхалися. Довелося трохи скинути швидкість, щоб стало краще\".\r\n \r\nДмитро Підручний, який завершив мас-старт 23-м, і зовсім ризикував зійти з перегонів.');
INSERT INTO `text` (`id`, `DocumentID`, `RawText`) VALUES
(83, '82ff7dcd-5ac5-45bb-ad0e-c37983f32c98', 'Уявіть, якби гонка закінчилася після другого вогневого рубежу! Адже лідером зі стадіону вийшов Дмитро Підручний. Мрії, мрії! Проте навіть без участі капітана нашої команди розв\'язка за призові місця вийшла супервидовищною.\r\n \r\nЯк ви вже здогадалися, прекрасний початок гонки провів Дмитро Підручний. Два ідеально відпрацьованих вогневі рубежі - і українець розташувався на першому рядку протоколу. А за ним найшвидші біатлоністи світу: Мартен Фуркад і Йоханнес Бо.'),
(84, 'a8e82059-8571-47fc-ab19-e109ccf31cb9', 'Француз накрутив темп, обігнав Підручного і помчав до першої стійки. Однак за лідером загального заліку вчепився Бо і Лессер. Вони підійшли до третього вогневого рубежу разом. Тут несподівано не зміг впоратися зі своїм же темпом Мартен Фуркад, допустивши промах. Залишилися тільки два спортсмени, які відстрілялися чисто - Бо і Лессер.\r\n \r\nУ той же час Дмитро Підручний \"надихався\" на трасі, що призвело до загострення травми спини. Давня проблема Діми дала про себе знати на стійці, де три промахи вибили українця за межі топ-20.'),
(85, 'cfe3abb5-db4d-4fbf-8b1a-61c634fcf396', 'Третій змагальний день без перерви. З огляду на такий напружений графік змагань у Доломітових Альпах, біатлоністи вели гонку обережно, намагаючись не прискорюватися, щоб не потрапити в кризу на високогір\'ї. У підсумку до вирішальної стійки дев\'ять спортсменів прийшли за 14 секундах один від одного.\r\n \r\nСправжня боротьба нервів супроводжувала спортсменів на вирішальному вогневому рубежі. Поки інші помилялися, Бо і Фійон Майї відпрацювали чітко і помчали з\'ясовувати, хто буде стояти на найвищій сходинці п\'єдесталу. Свіжіший вигляд на дистанції мав норвежець, який із легкістю обіграв француза на фініші. До речі, Йоханнес став єдиним, хто без промахів пройшов всі вогневі рубежі.'),
(86, '5218147c-c158-4080-b61d-15c66d6b5497', 'Бронза в руках Антона Шипуліна. Король Антхольца намагався наблизитися до лідера дуету, але йому не вистачило сил. Більше того, росіянина ледь не наздогнали два \"леви\" біатлону: Мартен Фуркад і Еміль Хегле Свендсен. Однак їм не вистачило дистанції, і вони задовольнялися боротьбою за четверте місце, де сильнішим виявився норвежець. Дуже важлива перемога для Еміля з психологічної точки зору після вчорашнього програного фінішу в естафеті.\r\n \r\nНайкращим серед українців став Сергій Семенов. Допустивши два промахи, закінчив гонку на 18-му місці, що дозволило увірватися в топ-20 загального заліку. Тріумфатор початку гонки Дмитро Підручний фінішував 22-м. А Володимир Семаков повторив результат мас-старту в Оберхофі, зайнявши 25-е місце.'),
(87, '7ef9abb0-89d8-4b9a-adb6-4aa954d52a5f', '«Учора класно біглося, але не пішла стрільба, сьогодні важко біглося, але зате добре стріляв. Перші півкола ще нормально було, а потім ноги і спина почали боліти. Спина взагалі перестала працювати. Ще трохи - і Ландертінгера міг би пропустити вперед. Організм трохи завантажений, і це відчувається. Саме до цього етапу не готувалися, Антхольц для нас як останнє тренування перед чемпіонатом світу. І це було досить гарне тренування. Але організму дуже важко, а мені ще бігти мас-старт.\r\n \r\nДуже приємно, що в Кубку націй ми випередили чехів. А четверті місця в естафетах - дуже гідно. Протягом останніх двох років тільки в Оберхофі ми були п\'яті, а так вище 7-8 місця ми не піднімалися ніколи. А зараз не просто четверті займаємо, а також боремося за третє. Бракує зовсім небагато: сьогодні швидкості, минулого разу - якогось одного запасного», - поскаржився на невезіння Підручний.'),
(88, 'c789b400-a0c4-4f2c-b712-3d66180e2921', 'Летючі лижники продовжують свою подорож Польщею. У цей вік-енд вони зазирнули в Закопане, де проходить шостий етап Кубка світу зі стрибків з трампліну. Після тріумфу польських спортсменів на Турне чотирьох трамплінів Польща переживає черговий сплеск уваги уболівальників.\r\n \r\nСьогодні на арені Вєлька-Крокєв зібралися 40000 людей - востаннє стільки людей збиралося в далекому 2002 році, щоб подивитися на легендарного Адама Малиша.'),
(89, 'ac7f7658-fa1e-4e21-ba88-ca8137a66289', 'Цього разу польська публіка прийшла з явною метою - спостерігати за перемогою своєї збірної в командних змаганнях. Тим більше, що підстави були: саме Польща виграла перший етап командного турніру в Клінгенталі, де вони обіграли господарів турніру німців.\r\n \r\nСклад Польщі в порівнянні з минулими змаганнями не змінився. Каміль Стох, Петро Жила, Мацей Кот і Давид Кубацький - саме вони привели польську збірну до вікторії на початку сезону. Однак сьогодні день у місцевих улюбленців не задався.\r\n \r\nПершим несподівано спіткнувся переможець Турне Каміль Стох, стрибнувши в першій спробі тільки на 125 метрів. Звичайно, у другому раунді Стох виправився, полетівши за 135 метрів.'),
(90, '0aee3e71-8028-4a2c-ba3f-519a6af9f6b0', 'Слабка ланка польської команди Давид Кубацький теж не відзначався на початку - стрибок на 120 метрів. Далі справи пішли краще, він приземлився на вісім метрів далі. Однак цього виявилося катастрофічно мало, щоб протистояти збірній Німеччини.\r\n \r\nНімці провели фантастичний день - лише один стрибок ближче, ніж на 130 метрів. І це за відсутності лідера команди Зеверіна Фройнда, який відновлюється після травми. Німеччина сповна помстилася полякам за програш на домашньому турнірі.'),
(91, 'b9ea4cac-005c-481b-8910-b95fef0f09d5', 'Бронза у словенців, призове місце яким забезпечив Петер Превц. Після провального початку сезону він повернувся у звичну форму, полетівши на 137,5 метрів - найкращий результат дня.\r\n \r\nМолодший брат Домен стрибав не так чудово, але теж гідно. Завтра нас чекає чудова боротьба між Петером Превцом, Жилою, Стохом, Веллінгером і Танде в особистих змаганнях.\r\n \r\nЗа подіумом розташувалися збірні Австрії і Норвегії. Якщо австрійці ослаблені відсутністю хворого Штефана Крафта, то у норвежців Танде не в змозі самотужки витягти всю команду.'),
(92, '75972193-d692-4d88-ad8d-dcf8bb2ffe51', 'Завтра етап в Антхольц - Антерсельві підійде до свого логічного завершення. Фінальною його гонкою стане естафета у жінок. Сьогодні тренерський штаб збірної України назвав склад учасниць, які візьмуть участь у командній гонці.\r\n \r\nРоль забійниці у завтрашній гонці на себе візьме Юлія Журавок, другий етап даний на відкуп Юлії Джимі. Після довгої відсутності в естафету повертається Валя Семеренко - третій етап. А завершувати гонку, трохи несподівано, буде Анастасія Меркушина, яка в Антхольці показала один із найгірших для себе показників стрільби в цьому сезоні.'),
(93, 'f53b8afe-a4e2-4e98-9d30-c3fd78f0f87b', 'Як і в жіночій гонці, для багатьох лижників етап у Скандинавії став першим після Тур де Скі. Однак старт в Ульрісехамні вирішили пропустити Сергій Устюгов і Матті Хейккінен. За відсутності переможця Тур де Скі претензії на найвищий щабель п\'єдесталу відразу позначив канадець Алекс Харвей, який вийшов у лідери вже наприкінці першого кола, не віддавши перемогу до фінішу.'),
(94, '9947b325-0027-4657-984e-bcaf94b4d5a9', 'Срібло у норвежця Мартіна Сундбю. Почавши гонку досить слабо, Мартін за два кілометри до фінішу програвав 16 секунд. Проте Сундбю накрутив темп і пройшов фінішне коло блискуче, відігравши у Харвея 10 секунд і вирвавши друге місце. Третє місце і бронза в активі шведа Маркуса Хельнера, який повторив результат Шарлотти Кали в жіночій гонці. Ледь не засмутив місцевих уболівальників Даріо Колонья, програвши всього 0,4 секунди місцевому Хельнеру.\r\n \r\nВідзначимо прекрасний результат Даніеля Стока й Ендрю Масгрейва, які виступають за одну з найсильніших марафонських команд Lease Plan, власником якої є відомий в минулому норвезький лижник Томас Альсгорд.'),
(95, '80112d98-a5ef-48ea-b9c2-f8d4b191c739', 'Чоловіки вирішили не розчаровувати уболівальників, повторивши найяскравішу жіночу гонку, але в естафеті. На останніх метрах дистанції розгорнулася справжня боротьба за золото і бронзу!\r\n \r\nНайприємніше, що поборотися за третє місце намагався Дмитро Підручний, але не зміг протистояти натиску російського спортсмена Антона Бабікова. Знову, втретє в сезоні, чоловіча збірна України займає почесне четверте місце!'),
(96, '731b1529-31d6-4e41-8349-f9f692784ff4', 'На першому етапі стрілянина підвела Артема Приму. Три додаткові патрони і 14-е місце на передачі естафети. Тріумфатор вчорашньої індивідуалки Сергій Семенов зміг підтягнути нашу команду до восьмого місця. Чудовий третій етап у виконанні Володимира Семакова - один промах і прекрасна швидкість дозволили Семакову вивести нас на четверте місце!\r\n \r\nНайскладніше завдання стояло перед Дмитром Підручним. Лише трохи не вистачило капітанові нашої збірної на фінішному колі, щоб обігнати Антона Бабікова. Все-таки багато сил витратив Підручний на початку гонки!'),
(97, '5c648dab-b2cb-4479-95fe-92c2ec7cef11', 'За відсутності Мартена Фуркада й Антона Шипуліна, які вирішили пропустити гонку через підготовку до чемпіонату світу, на перші ролі вийшли Симон Шемпп і Еміль Хегле Свендсен. Норвежець мав перевагу в 17 секунд, але стрілянина підвела лідера норвезької збірної. Два додаткові патрони на стійці - і ось Шемпп зі Свендсеном разом ідуть зі стадіону, залишивши розв\'язку на фінішну пряму. Король Антхольца Симон Шемпп виглядав переконливіше, вигравши у норвежця, який пропустив індивідуальну гонку.\r\n \r\nЗавдяки четвертому місцю збірна України піднялася на шосте місце в Кубку Націй, випередивши чехів. До бажаного п\'ятого місця, яке дає максимальну квоту, українцям залишилося відіграти 176 очок у австрійців.'),
(98, 'f246da6d-5ad2-48e9-8f2d-a37f5810f558', 'На цьому тижні Кубок світу з лижних гонок повертається у Скандинавію: протягом двох вікендів спортсмени змагатимуться у Швеції. Першими лижників прийняло містечко Ульрисехамн, розташоване на півдні Швеції у чудовому місці на озері Осундсен. У цьому шведському місті, заснованому у 1400 році, досі збереглася атмосфера Середньовіччя. Проте тут вже десятки років розвиваються різні форми туризму, зокрема гірськолижного. Ці вихідні - справжнє свято для жителів «середньовічного» міста, які вперше приймають змагання світового рівня.'),
(99, '8b4f0198-afe0-4238-8fb0-32ba6ef94595', 'Першими на старт вийшли жінки у гонці на ковзанах з роздільним стартом на 10 кілометрів. Етап в Ульрисіхамні супроводжується як гучними поверненнями, так і пропусками. Вперше ми побачимо Маріт Бьорген, яка останній раз виступала ще у грудні в Ля Клюза. Однак на старт не вийде місцева зірка Стіна Нільссон. Шведці потрібен час для відновлення і тренувального періоду після успішного виступу на Тур де Скі.'),
(100, 'fdbd7ad4-df01-4581-90ea-e86fbacf2508', 'Перемогу у гонці здобула норвежка Маріт Бьорген. Це 22-га вікторія норвежки на етапах у Швеції. Ніхто з лижниць так не домінував на шведських землях, другою йде Олена Вяльбе з вісьмома, і третьої Бенте Ськарі з п\'ятьма перемогами. Другою стала фінка Кріста Пармакоська, яка програла 10 секунд Бьорген. Бронзу під крики 30-тисячної рідної публіки виграла шведка Шарлотта Калла. На фініші Калла лише на 0,8 секунди випередила норвежку Астрід Якобсен, для якої це перші змагання у 2017 році.\r\n \r\nЛідер загального заліку Хейді Венг виступила менш вдало, посівши шосте місце. Слідом за нею фінішували Джессіка Діггінс і Ханна Фальк. Мабуть, лижниці ще не встигли повністю відновитися після виснажливого Тур де Скі.');
